```rust
use reqwest::blocking::get;
use serde_json::json;
use std::process::Command;
use clipboard::{ClipboardContext, ClipboardError};

const ELEVENLABS_API_KEY: &str = "YOUR_ELEVENLABS_API_KEY";
const ELEVENLABS_API_URL: &str = "https://api.elevenlabs.io/v1/tts";

fn main() -> Result<(), Box<dyn std::error::Error>> {
    let mut ctx = ClipboardContext::new()?;
    let text = ctx.get_contents()?;

    let client = reqwest::blocking::Client::new();
    let response = client.post(ELEVENLABS_API_URL)
        .header("Authorization", format!("Bearer {}", ELEVENLABS_API_KEY))
        .json(&json!({
            "text": text,
            "voice": "en-US-Wavenet-A",
            "speed": 1.0,
            "pitch": 1.0,
        }))?
        .send()?;

    let response_json: serde_json::Value = response.json()?;
    let audio_url = response_json["audio_url"].as_str().unwrap();

    let mut cmd = Command::new("mpg321");
    cmd.arg(audio_url);
    cmd.spawn()?.wait()?;

    Ok(())
}
```
